	self.VerticalMinimalScrollbar = VerticalMinimalScrollbar
	
	f0_local0( self, f1_local1, controller )
	if CONDITIONS.IsSplitscreen() then
		ACTIONS.AnimateSequence( self, "Splitscreen", controller )
	end
	return self
end

